import React, { useState } from "react";

export default function Test11() {
 
    const [formvalue , setformvalue]=(useState({
        firstname:"",
        lastename:"",
        ans:""

    }))
    const displaysubmit=(e)=>{
        e.preventDefault()
        const currentTarget = e.currentTarget
        const id= currentTarget.id 
        console.log("ffffffffff"  , id)                  
        const value= currentTarget.value
        if(value) 
        setformvalue((preventstate)=>{
            return {...preventstate ,  ...{[id]:value} }
           
        })
        console.log("ddddd",formvalue)
        
    }

    return(
        <>
        {JSON.stringify(formvalue)}
        <div class="form-group">
              
      <form action=""   onClick={displaysubmit} >

      <div class="form-group">
      <label for="">firstname</label>
<input type="text" name="firstname" id="firstname" onChange={displaysubmit}/> 
</div>
<div class="form-group">
<label for="">lastename</label>
<input type="text" name="lastename" id="lastename" onChange={displaysubmit}/>
</div> 
<div class="form-group">

<label for="">annes</label>
<input type="text" name="ans" id="ans" onChange={displaysubmit}/>

</div>
<div class="form-group">

<input type="checkbox" name="checkbox" id="checkbox" onChange={displaysubmit} /> 
</div>

      </form>
  <button type="submit" name="submit" id="submit" > click</button>
        </div>
        </>
    )
}
